import React from 'react'

const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Seller Type</th>
                <th>Average in Euro</th>
            </tr>
        </thead>
    );
}

const TableBody = ({ value }) => {
    return (
        <tr >
            <td>other</td>
            <td>{value.other}</td>
        </tr>,
        <tr >
            <td>Dealer</td>
            <td>{value.dealer}</td>
        </tr>,
        <tr >
            <td>private</td>
            <td>{value.private}</td>
        </tr>

    );
}
const AverageListing = ({ averageListing }) => {
    return (
        <div>
            <center><h1>Average Listing</h1></center>

            <div class="card">
                <div class="card-body">
                    <h5 class="card-title">Other</h5>
                    <p class="card-text">{averageListing.other}</p>
                    <h5 class="card-title">Dealer</h5>
                    <p class="card-text">{averageListing.dealer}</p>
                    <h5 class="card-title">Private</h5>
                    <p class="card-text">{averageListing.private}</p>
                </div>
            </div>

        </div>
    )
};

export default AverageListing
